### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Data Structures and Algorithms**
   - **Pseudocode Interpretation**: Understanding and writing pseudocode to solve problems.
   - **Data Manipulation**: Moving, reading, and manipulating data between tables.
   - **Sorting and Searching**: Basic algorithms for sorting and searching data.
   - **Counting and Iteration**: Using loops and counters to process data.

2. **Data Analysis**
   - **Dataset Analysis**: Analyzing datasets to extract useful information.
   - **Conditional Statements**: Using if-else statements to filter and process data.
   - **Aggregation**: Summing, counting, and other aggregation techniques.

3. **Mathematical Concepts**
   - **Logical Expressions**: Evaluating logical expressions and conditions.
   - **Mathematical Operations**: Basic arithmetic and comparison operations.
   - **Equations**: Understanding and applying mathematical equations in code.

4. **Programming Concepts**
   - **Procedures and Functions**: Writing and calling procedures/functions.
   - **Variables and Initialization**: Proper initialization and use of variables.
   - **Control Structures**: Using loops and conditional statements effectively.

5. **Data Types and Structures**
   - **Tables and Datasets**: Understanding and manipulating tabular data.
   - **Strings and Characters**: Processing and analyzing text data.

#### Important Equations and Logical Expressions

1. **Logical Expressions**
   - `2 == 2 or 2 > 3` evaluates to `True`.
   - `2 == 2 and 2 > 3` evaluates to `False`.
   - `2 = 3` is an invalid expression.
   - `2 + '2'` results in `'22'` (string concatenation).
   - `2 < 3` evaluates to `True`.

2. **Mathematical Equations**
   - **Fraction Calculation**:
     \[
     \text{fracTrue} = \frac{\text{countPerSub}}{\text{countOverall}}
     \]
   - **Percentage Calculation**:
     \[
     \frac{\text{countG}}{\text{countT}} \geq \frac{\text{num}}{100}
     \]

3. **Conditional Statements in Pseudocode**
   - **Example of a conditional statement**:
     ```plaintext
     if (X.Total ≥ 180) {
         countOverall = countOverall + 1
         if (X.Physics ≥ 60 and X.Chemistry ≥ 60 and X.Mathematics ≥ 60) {
             countPerSub = countPerSub + 1
         }
     }
     ```

4. **Loop Structures**
   - **While Loop**:
     ```plaintext
     while (Table 1 has more rows) {
         Read the first row X from Table 1
         // Process the row
         Move X to Table 2
     }
     ```

5. **Procedures and Functions**
   - **Example Procedure**:
     ```plaintext
     Procedure miniSum(A, B, C)
         Sum = 0
         if (A > C and A > B) {
             Sum = B + C
         } else if (B > C and B > A) {
             Sum = A + C
         } else if (C > A and C > B) {
             Sum = A + B
         }
         return (Sum)
     End miniSum
     ```

